/**
 * Desordena un array indicado
 * @param {*} array Respuesta array desordenado
 */
function shuffle(array) {

    let counter = array.length;

    // While there are elements in the array
    while (counter > 0) {
        // Pick a random index
        let index = Math.floor(Math.random() * counter);

        // Decrease counter by 1
        counter--;

        // And swap the last element with it
        let temp = array[counter];
        array[counter] = array[index];
        array[index] = temp;
    }

    return array;
}

function randomEmail(){
    const chars = 'abcdefghijklmnopqrstuvwxyz1234567890';
    let string = '';
    
    for(let ii=0; ii<15; ii++){
        string += chars[Math.floor(Math.random() * chars.length)];
    }

    return string +  "@mail.com";
}

function randomAddress(){
    const chars = 'ABCDEFG';
    const street = ['Calle', 'Cra'];
    return `${street[Math.floor(Math.random())]} ${(Math.floor(Math.random() * 200) + 1)}${chars[Math.floor(Math.random() * chars.length)]} #${(Math.floor(Math.random() * 200) + 1)} - ${(Math.floor(Math.random() * 200) + 1)}`;
}


const getCuentas = function (total) {


    let cuentas = [];
    let cortes = [1,5,9,12,16,20,23,26];


    for (let i = 0; i < total; i++) {
        const numeroCuenta = "" + (Math.floor(Math.random() * 99999999) + 10000000) + "";
        const totalPrepago = Math.floor(Math.random() * 90);
        const totalPospago = Math.floor(Math.random() * 90);
        const corte = cortes[Math.floor(Math.random()* 7)]; 
        
        const email = Math.random() > 0.7 ? '' : randomEmail();
        const direccion =  email === '' ? randomAddress() : (Math.random() > 0.5 ? randomAddress() : '');



        const cuenta = {
            "numero": numeroCuenta,
            "total_prepago": totalPospago,
            "total_postpago": totalPrepago,
            "corte": corte,
            "facturacion": {
                "email": email,
                "direccion":  direccion
            },
            "lineas_postpago": shuffle(lineas).slice(0, this.total_postpago).map((linea) => {
                const consumoPostpago = Math.random() * 100;
                const lineaOb = {
                    "tipo": "postpago",
                    "numero": linea,
                    "cuenta": numeroCuenta,
                    "consumo": consumoPostpago
                }

                return lineaOb;

            }),
            "lineas_prepago": shuffle(lineas).slice(0, this.total_prepago).map((linea) => {
                const consumoPrepago = Math.random() * 100;
                const lineaOb = {
                    "tipo": "prepago",
                    "numero": linea,
                    "cuenta": numeroCuenta,
                    "consumo": consumoPrepago
                }

                return lineaOb;

            })
        };

        cuentas.push(cuenta);
    }



    return cuentas;
};

